// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract Election {
    int public votesToAdd;
    int public votesToRemove;
    mapping(address => bool) public hasVoted;

    modifier notVoted(address adminAddr) {
        require(
            hasVoted[adminAddr] == false,
            "Admin has already voted"
        );
        _;
    }

    function voteToAdd(address adminAddr) notVoted(adminAddr) public {
        votesToAdd += 1;
        hasVoted[adminAddr] = true;
    }

    function voteToRemove(address adminAddr) notVoted(adminAddr) public {
        votesToRemove += 1;
        hasVoted[adminAddr] = true;
    } 
}

